  return (
    <div className="NavBar">
      <div className="Bar">
        <Brand />

        <ul id="nav">
          {/* <Link to="/about">
            <li>About</li>
          </Link> */}
          {/* <Link to="/gallery">
            <li>The Gallery</li>
          </Link> */}


          <Link to="/gallery" className="nav-item">
