          </span>
          <span className="nav-item">
            <Link to="/gallery">
              <li>Contact</li>
            </Link>
          </span> */}
        </ul>
      </div>
    </div>
  )

}

function copyEmail() {
  console.log('copy!');
}

export default NavBar
